backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./modules/vpc/main.tf.code:
resource "aws_vpc" "example" {
  cidr_block           = var.cidr_block
  enable_dns_support   = true
  enable_dns_hostnames = true

  tags = {
    Name = "cloud-ai-vpc"
  }
}

resource "aws_subnet" "example" {
  vpc_id                  = aws_vpc.example.id
  cidr_block              = element(var.subnet_cidr_blocks, count.index)
  availability_zone       = element(var.availability_zones, count.index)
  map_public_ip_on_launch = true

  count = length(var.subnet_cidr_blocks)

  tags = {
    Name = "cloud-ai-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "example" {
  vpc_id = aws_vpc.example.id

  tags = {
    Name = "cloud-ai-igw"
  }
}

resource "aws_route_table" "example" {
  vpc_id = aws_vpc.example.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.example.id
  }

  tags = {
    Name = "cloud-ai-route-table"
  }
}

resource "aws_route_table_association" "example" {
  count = length(aws_subnet.example)

  subnet_id      = aws_subnet.example[count.index].id
  route_table_id = aws_route_table.example.id
}

./modules/vpc/variables.tf.code:
variable "cidr_block" {
  description = "The CIDR block for the VPC"
  type        = string
}

variable "subnet_cidr_blocks" {
  description = "List of CIDR blocks for the Subnets"
  type        = list(string)
}

variable "availability_zones" {
  description = "List of availability zones in which to create the subnets"
  type        = list(string)
}

./modules/vpc/outputs.tf.code:
output "vpc_id" {
  value       = aws_vpc.example.id
  description = "The ID of the VPC"
}

output "subnet_ids" {
  value       = aws_subnet.example[*].id
  description = "The IDs of the subnets"
}

output "internet_gateway_id" {
  value       = aws_internet_gateway.example.id
  description = "The ID of the Internet Gateway"
}

./modules/ec2/main.tf.code:
resource "aws_security_group" "asg_security_group" {
  name        = "cloud-ai-asg-sg"
  description = "Security group for Autoscaling Group EC2 instances"
  vpc_id      = var.vpc_id

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = [var.alb_access_cidr]
  }
}

resource "aws_launch_configuration" "asg_launch_configuration" {
  name_prefix          = "cloud-ai-launch-configuration-"
  image_id             = var.ami_id
  instance_type        = var.instance_type
  security_groups      = [aws_security_group.asg_security_group.id]
  user_data            = file("${path.module}/userdata.sh")
  associate_public_ip_address = true

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "asg" {
  name_prefix           = "cloud-ai-asg-"
  launch_configuration  = aws_launch_configuration.asg_launch_configuration.id
  vpc_zone_identifier   = var.subnet_ids
  min_size              = var.asg_min_size
  max_size              = var.asg_max_size
  desired_capacity      = var.asg_desired_capacity
  health_check_type     = "EC2"

  tag {
    key                 = "Name"
    value               = "cloud-ai-instance"
    propagate_at_launch = true
  }

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_lb" "alb" {
  name               = "cloud-ai-alb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.asg_security_group.id]
  subnets            = var.subnet_ids

  enable_deletion_protection = false
}

resource "aws_lb_target_group" "asg_target_group" {
  name     = "cloud-ai-target-group"
  port     = 80
  protocol = "HTTP"
  vpc_id   = var.vpc_id

  health_check {
    interval            = 30
    path                = "/"
    timeout             = 5
    healthy_threshold   = 2
    unhealthy_threshold = 2
    protocol            = "HTTP"
    matcher             = "200-299"
  }
}

resource "aws_lb_listener" "alb_listener" {
  load_balancer_arn = aws_lb.alb.arn
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_lb_target_group.asg_target_group.arn
  }
}

./modules/ec2/variables.tf.code:
variable "vpc_id" {
  description = "The ID of the VPC where the resources will be deployed"
  type        = string
}

variable "subnet_ids" {
  description = "List of subnet IDs to place the Autoscaling Group instances in"
  type        = list(string)
}

variable "ami_id" {
  description = "The ID of the AMI to use for the EC2 instances"
  type        = string
  default     = "ami-0b0ea68c435eb488d"
}

variable "instance_type" {
  description = "The instance type of the EC2 instances"
  type        = string
  default     = "t3.micro"
}

variable "asg_min_size" {
  description = "The minimum size of the Autoscaling Group"
  type        = number
  default     = 1
}

variable "asg_max_size" {
  description = "The maximum size of the Autoscaling Group"
  type        = number
  default     = 3
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the Autoscaling Group"
  type        = number
  default     = 1
}

variable "alb_access_cidr" {
  description = "The CIDR block to allow access to the ALB"
  type        = string
  default     = "0.0.0.0/0"
}

./modules/ec2/outputs.tf.code:
output "alb_dns_name" {
  value       = aws_lb.alb.dns_name
  description = "The DNS name of the Application Load Balancer (ALB)"
}

output "asg_name" {
  value       = aws_autoscaling_group.asg.name
  description = "The name of the Autoscaling Group"
}

